import React, { Component } from 'react';
import PropTypes from 'prop-types';


class Myrecipe extends Component {


  render() {

    const ingredients = this.props.ingredients.map((item, i) => {
      return (
        item.text
      )
    })

    const healthlabel = this.props.healthLables.map((item, i) => {
      return(item)
    })

    return (
      <div className="recipe-container">
        <div className="item-list_container" onClick={() => recipeDetailCallback()}>
          <h4>{this.props.label}</h4>
          <img src={this.props.image} alt='' />
          <div>
            {ingredients}
          </div>
          <div>{healthlabel}</div>
          <div>
            {this.props.recipeurl}
          </div>
        </div>
      </div>
    )
  }

}

Myrecipe.propTypes = {
  recipeDetailCallback: PropTypes.func
}


export default Myrecipe;
